import '../styles/cards.css'
import Header from '../layout/Header'
import Footer from '../layout/Footer'
import Cards from '../Cards'

class Home extends Component{
    state={
        datos:{}
    }
    componentDidMount(){
        Axios.get('http://www.omdbapi.com/?apikey=f3feb2fc&t=Avengers&y=2018',)
            .then(res => {console.log({datos:res.data})})
            .catch(err => console.log(err));
    }
    render(){
        return(
            <div>
                <Header />
                <h2 className="encabezados">Ultimos Lanzamientos</h2>
                {this.state.datos(dato=>
                   <Cards 
                   img={dato.poster}
                   titulo={dato.title}
                   sinopsis={dato.plot}
                   id={dato.imdbid}
                   /> )}

